import React from "react";
import { useQuery } from "react-query";
import axios from "axios";

import ProductCard from "../components/productCard/ProductCard";
import Search from "../components/search/Search";

interface Botswana {
  id: number;
  name: string;
  destinations: {
    featuredMultiMarket: FeaturedMarket[];
    multiMarket: MultiMarket[];
  };
}

interface FeaturedMarket {
  id: number;
  days: number;
  destination: string;
  extraNights: number;
  hasPrivateTour: boolean;
  hasSoloTraveller: boolean;
  priceDetail: {
    fromPriceBeautify: string;
    oldPriceBeautify: string;
    pricePerNight: string;
    pricingPercentage: number;
  };
  tags: Tag[];
  title: string;
  images: Image[];
}

interface MultiMarket extends FeaturedMarket {}

interface Tag {
  alias: string;
  id: number;
}

interface Image {
  desktop: string;
  mobile: string;
}

const ProductsList: React.FC = () => {
  const handleSearch = (query: string) => {
    // handle search logic here
  };

  const fetchBotswanaData = async () => {
    const { data } = await axios.get<Botswana[]>(
      "https://api-us.exoticca.com/api/landing/v2/country/botswana"
    );
    console.log("data Botswana", data);
    return data;
  };

  const {
    data: botswanaData,
    isLoading,
    isError,
  } = useQuery<Botswana[], Error>("botswanaData", fetchBotswanaData);

  return (
    <div>
      <h1>Products List</h1>
      <Search onSearch={handleSearch} />
      {isLoading ? (
        <div>Loading...</div>
      ) : isError ? (
        <div>Error fetching data</div>
      ) : (
        <>
          {botswanaData &&
            botswanaData.map((botswana) => (
              <div key={botswana.id}>
                <h2>{botswana.name}</h2>
                <h3>Featured Multi Market:</h3>
                {botswana.destinations.featuredMultiMarket.map(
                  (featuredMultiMarketProduct) => (
                    <ProductCard
                      product={featuredMultiMarketProduct}
                    />
                  )
                )}
                <h3>Multi Market:</h3>
                {/* Renderizar multiMarket aqu√≠ */}
              </div>
            ))}
        </>
      )}
    </div>
  );
};

export default ProductsList;
